import React, { Component } from 'react'
import {Link} from 'react-router-dom';

class Menu extends Component {
  render() {
    return (
      <div>
        <ul>
          <Link to="/"><li>About</li></Link>
          <Link to="/"></Link><li>Projects</li>
          <Link to="/"></Link><li>Skills</li>
          <Link to="/"></Link><li>Experience</li>
          <Link to="/"></Link><li>Contacts</li>
        </ul>
      </div>
    )
  }
}


export default Menu;
